      "date": "1760-01-01",
      "tags_section": "",
      "text": "20. Zwölf Säck neuer Waisen in billigem Preis, im Berichtshaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs-Atlas von 65 theils Land- Karten, Städten, Plans von Bataillen und Belagerungen des jügigen Kriegs. 2) Die Welt in einer Kugel mit Kupfern. 3) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "22. Zwoy säubere französische Better in ein Wirths- Haus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "23. Eine Bebauung in der Aichemer Vorstadt mit 4 Stuben, 5 Kammern samt einer gros- sen Werkstatt, Ehrig und einem schönen ge- wölbten Keller und Garten, weshalb sich bey Hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "24. Ein Freund, welcher circa 600 Sefer Hanf- Saamen anhero liefern könnte, möchte aber solchen vorhero verkauf wissen, offeriert selbi- gen dahero in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "25. Wo guter alter weißer Wein zu haben, ist bey Mr. Michael Fuchs dem Kuefer zu ver- nehmen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "26. Circa 6. Saunt extra guter alter pur rother Odsheimer Wein, so gut als Heutenburger oder Burgunder, in billigem Preis, im Bericht- haus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "27. Zwoy Stücklein weißer Wein von 1760, à 8 Pfund 10 s der Saunt im einen, und à 8 Pfund im anderen, wovon nach Belieben zu er- fragen, im Berichtshaus ohne Entgelt zu er- fragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "28. Ein Stock Heu ab 3 Thaler Matten vorm Riechemer-Thor oberhalb der Schowenbruck, Kerner ein Stücklein von 17 Saumen rothen Bölliger-Wein in 1760, schön roth-und lau- ter, im Berichtshaus ohne Entgelt zu erfra- gen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "29. Auf E. E. Junst zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "30. Ein roth Scharlach Camisol und Hosen in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "31. Im Offenburger-Hof ist wohlverwahrter Bau zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "32. Ein Brennhauslein bey der Steinen-Mühlin mit aller Kommtlichkeit, im Berichtshaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "33. Bey weine rother und weißer Burgunder, wie auch Muskat-Wein, Piecenweis wegen Margel Vlages, wie auch roth und weißer 1753er Margrafer-Wein in billigem Preis zu haben, ist im Berichtshaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "34. Feine heitergelbe Hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichtshaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "35. Seren Hofkach des Siegriffs Behauflung ins Spiegelsklein mit 4 Stuben, 3 Kammern ec. ist entweder zu verkaufen, oder samethaft zu verleihen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "36. Weiße und rothe Margrafer-Weine von 1760, wovon in billigem Preis nach Belieben zu haben, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "37. Ein Mannensig in St. Peters Kirch auf dem Letner. Stem ein grün Tombrau-Betklein mit grünen wollenen Umhängen, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "38. Ein Haushslitten mit einem schönen Bild und Zugehördt in billigem Preis, im Bericht- haus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "39. Der Bärenfelsers Hof zu St. Peter, mit Garten, Stallung, Keller ec. wie der Augen- schein zeigen wird. In Ermanglung eines Käufers"
